INSERT INTO `adminnotification_inbox` VALUES ('111', '4', '2013-03-11 23:36:04', 'MageMonkey new version v1.1.1', 'A new version has been released, change log is.\n- Adding start date for abandoned cart', 'http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html', '0', '0');
INSERT INTO `adminnotification_inbox` VALUES ('112', '4', '2013-03-19 22:18:26', 'New MageMonkey version with bug fixes for Abandoned Carts', 'Release notes are:\n- Fix for abandoned cart multi store management\n- Fix for abandoned cart not send email for a quote who has an order posterior from the same customer', 'http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html', '0', '0');
INSERT INTO `adminnotification_inbox` VALUES ('113', '4', '2013-07-03 22:49:46', 'New MageMonkey version, featuring autoresponders', 'On July 2nd we uploaded version 1.1.12 it includes autoresponders, we hope you enjoy it.', 'http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html', '0', '0');
INSERT INTO `adminnotification_inbox` VALUES ('114', '4', '2013-03-18 03:07:19', 'Increase your sales with MageMonkeys free <<RECOVER ABANDONED CARTS>>', 'Abandoned Cart - is part of the latest version of the MageMonkey Module. It sends an automated email to shoppers who have added your products to their shopping cart, but didn\'t complete the checkout process. This reminder may then encourage the shopper to return and place their order.', 'http://ebizmarts.com/blog/2013/03/increase-your-sales-with-magemonkeys-free-recover-abandoned-carts', '0', '0');
