INSERT INTO `cms_block` VALUES ('10', 'List categories top', 'list-categories-top', '<div class=\"list-categories-top\">\r\n<ul>\r\n<li><a href=\"{{store url=\"womens.html\"}}\"><span>WOMEN\'S</span><img src=\"{{media url=\"wysiwyg/women.jpg\"}}\" alt=\"\" /></a></li>\r\n<li><a href=\"{{store url=\"kids.html\"}}\"><span>KIDS</span><img src=\"{{media url=\"wysiwyg/kid.jpg\"}}\" alt=\"\" /></a></li>\r\n<li><a href=\"{{store url=\"mens.html\"}}\"><span>MEN\'S</span><img src=\"{{media url=\"wysiwyg/men.jpg\"}}\" alt=\"\" /></a></li>\r\n</ul>\r\n</div>', '2013-08-08 04:14:51', '2013-08-08 04:32:15', '1');
INSERT INTO `cms_block` VALUES ('11', 'List categories bottom', 'list-categories-bottom', '<div class=\"list-categories-bottom\">\r\n<ul>\r\n<li><a id=\"example1\" href=\"{{media url=\"wysiwyg/slide.png\"}}\"><img src=\"{{media url=\"wysiwyg/intastagram.jpg\"}}\" alt=\"\" /></a> <a id=\"example1\" href=\"{{media url=\"wysiwyg/slide.png\"}}\"><img src=\"{{media url=\"wysiwyg/most_recent.jpg\"}}\" alt=\"\" /></a></li>\r\n<li><a href=\"{{store url=\"womens.html\"}}\"><span>TOPS</span><img src=\"{{media url=\"wysiwyg/tops.jpg\"}}\" alt=\"\" /></a></li>\r\n<li><a href=\"{{store url=\"womens.html\"}}\"><span>BOTTOMS</span><img src=\"{{media url=\"wysiwyg/bottoms.jpg\"}}\" alt=\"\" /></a></li>\r\n</ul>\r\n</div>', '2013-08-08 04:32:42', '2013-08-22 18:57:10', '1');
INSERT INTO `cms_block` VALUES ('12', 'What We Accept', 'what-we-accept', '<div class=\"left-block\">\r\n<div class=\"text-block\">\r\n<h3>YES</h3>\r\nClothing In New To Like-New Condition<br />\r\n<div class=\"left-content\">Items should be in pristine condition. Learn more about our high quality standards here.</div>\r\n<br /> Clothing That\'s Freshly Laundered<br />\r\n<div class=\"left-content\">Clothing should look and smell clean. Please wash and fully dry all clothing before placing it in the bag. Clothing that is still moist does not travel well in a sealed plastic bag</div>\r\n<br /> Top Brands<br />\r\n<div class=\"left-content\">Such as Tea Collection, Gap, Gymboree, and Hanna Andersson for kids. For women\'s clothing we love J Crew, Anthropologie, Ann Taylor, Banana Republic, Theory, and Tommy Hilfiger</div>\r\n<br /> Nwt (New With Tags) Items<br />\r\n<div class=\"left-content\">We pay more for items that are so new that they still include price tags - however, we do not guarantee we accept all nwt tag items, as they must still meet our standards and be free of imperfections</div>\r\n<br /> Outfits<br />\r\n<div class=\"left-content\">Help us identify items meant to go together by clipping them together or putting them in a smaller bag<br /><br /> Clothing Related Accessories<br /> Like hats, mittens, and scarves</div>\r\n<br /> Shoes<br />\r\n<div class=\"left-content\">In addition to checking the top surface and interior of footwear, please be sure to check the soles to ensure they are clean and free of scuff marks</div>\r\n</div>\r\n</div>\r\n<div class=\"right-block\">\r\n<div class=\"text-block\">\r\n<h3>NO</h3>\r\nClothing That Shows Any Signs Of Wear<br />\r\n<div class=\"left-content\">Any clothing with rips, tears, stains, pilling, fading, shrinkage, etc., cannot be accepted</div>\r\n<br /> Clothing From Discount Brands<br />\r\n<div class=\"left-content\">Athletics Works, Faded Glory, Garaminals, George, Kids Connection, Koala Kids, Max Grey, Sonoma and Walmart.</div>\r\n<br /> Sleepwear, Socks And Undergarments<br /><br /> Specialty Items<br />\r\n<div class=\"left-content\">Like real fur items, prom dresses, bridesmaids dresses, wedding dresses. However, we do take cocktail dresses</div>\r\n<br /> Items Missing Labels<br />\r\n<div class=\"left-content\">Brand and size need to be identifiable</div>\r\n<br /> Homemade/Altered Items<br />\r\n<div class=\"left-content\">Especially any kids\' clothing or women\'s dresses (women\'s jeans are ok)</div>\r\n<br /> Local Or Niche Clothing<br />\r\n<div class=\"left-content\">Hometown teams and places that do not have a broad national audience</div>\r\n</div>\r\n<div class=\"button-block\"><button class=\"button btn-next\" title=\"Next\" onclick=\"setLocation(\'#\')\" type=\"button\"><span><span>Next</span></span></button></div>\r\n</div>', '2013-08-10 02:05:48', '2013-08-10 03:45:01', '1');
INSERT INTO `cms_block` VALUES ('13', 'Instagram', 'instagram', '<div class=\"main-instagram\">\r\n<div class=\"title-instagram\">\r\n<h4>#shopgreene</h4>\r\n</div>\r\n<div class=\"main-image-instagram\">\r\n<div class=\"btn-pre-instagram\"><a href=\"#\"><img src=\"{{media url=\"wysiwyg/btn_pre.jpg\"}}\" alt=\"\" /></a></div>\r\n<div class=\"list-image-instagram\">\r\n<ul>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-1.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-2.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-3.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-4.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-5.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-6.jpg\"}}\" alt=\"\" /></li>\r\n<li><img src=\"{{media url=\"wysiwyg/Untitled-7.jpg\"}}\" alt=\"\" /></li>\r\n</ul>\r\n</div>\r\n<div class=\"btn-pre-instagram\"><a href=\"#\"><img src=\"{{media url=\"wysiwyg/btn_next.jpg\"}}\" alt=\"\" /></a></div>\r\n</div>\r\n<!--div class=\"block-instagram\">\r\n<div class=\"left-instagram\">\r\n<ul>\r\n<li><a href=\"#\"><img src=\"{{media url=\"wysiwyg/facebook.jpg\"}}\" alt=\"\" /></a></li>\r\n<li><a href=\"#\"><img src=\"{{media url=\"wysiwyg/rss.jpg\"}}\" alt=\"\" /></a></li>\r\n</ul>\r\n</div>\r\n<div class=\"right-instagram\"><img src=\"{{media url=\"wysiwyg/upload-instagram.jpg\"}}\" alt=\"\" /></div>\r\n</div-->\r\n</div>', '2013-08-27 22:20:43', '2013-09-06 18:44:29', '1');
INSERT INTO `cms_block` VALUES ('14', 'Click now for great deals on our online store', 'click-now-for-great', '<div class=\"clothing-guidelines-page\">\r\n<div class=\"header-page\">\r\n        <img src=\"{{media url=\"wysiwyg/clothing-guidelines-bg-title-top.png\"}}\" alt=\"\" />\r\n        <div class=\"title-header\">\r\n            <h2>Click now for great deals on our online store</h2>\r\n        </div>\r\n    </div>\r\n</div>', '2013-08-28 17:25:18', '2013-08-28 17:25:18', '1');
INSERT INTO `cms_block` VALUES ('17', 'Sell Your Clothes With Us', 'sell-your-clothes-with-us-page', '<div class=\"main-page sell-your-clothes-with-us-page\">\r\n<div class=\"title-page\">\r\n<h1>Sell Your Clothes With Us</h1>\r\n</div>\r\n<div class=\"content-page\">\r\n<div class=\"item-page\">\r\n<div class=\"left-item-page\"><img src=\"{{media url=\"wysiwyg/819OutlinesShopSell1_07.png\"}}\" alt=\"\" /></div>\r\n<div class=\"right-item-page\">\r\n<h2>Men\'s + Women\'s + Children\'s</h2>\r\n<ul>\r\n<li><label>1</label> <span>Order a bag which we\'ll send to you for free or print a prepaid shipping label.</span></li>\r\n<li><label>2</label> <span>Look over our guidelines and brand list to see if your items meet our criteria.</span></li>\r\n<li><label>3</label> <span>Fill the bag up with Women\'s, Men\'s, or Children\'s clothing and send it out.</span></li>\r\n<li><label>4</label> <span>We sell your stuff and you\'ll recieve 50% commission via check or PayPal!</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"item-page\">\r\n<div class=\"left-item-center-page\">\r\n<div class=\"left-item\">\r\n<h3>Yes</h3>\r\n<ul class=\"item-yes\">\r\n<li><span>Top brands like Anthropologie and J.Crew. Our motto\'s \"From Gap To Gucci\".</span></li>\r\n<li><span>Clothes that are in excellent condition. We love stuff still with tags on!</span></li>\r\n<li><span>Clothes that are clean and frshly laundered!</span></li>\r\n<li><span>Items that are no more than 2-3 years old.</span></li>\r\n<li><span>You can send us Women\'s, Men\'s, or Children\'s items! Ship all at once!</span></li>\r\n</ul>\r\n</div>\r\n<div class=\"right-item\">\r\n<h3>No</h3>\r\n<ul class=\"item-no\">\r\n<li><span>Discount brands from places like Walmart. We also don\'t accept homemade clothing!</span></li>\r\n<li><span>Clothes that are damaged. Items with stains, tears, or faded graphics usually don\'t sell well.</span></li>\r\n<li><span>Clothes that aren\'t washed or are missing labels.</span></li>\r\n<li><span>Swimwear or undergarments.</span></li>\r\n<li><span>Items that are out of style or over 3 years old.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"right-item-center-page\">\r\n<div class=\"brand-list\">\r\n<h2><a href=\"{{store url=\"brandlist\"}}\">Brand List</a></h2>\r\n<p>See which brands of Women\'s, Men\'s, or Children\'s clothing we take and which ones we don\'t.</p>\r\n</div>\r\n<div class=\"guidelines\">\r\n<h2><a href=\"{{store url=\"clothing-guidelines\"}}\">Guidelines</a></h2>\r\n<p>Read our full list of guidelines to make sure you\'re getting the most out of your recycled items.</p>\r\n</div>\r\n<div class=\"faq\">\r\n<h2><a href=\"{{store url=\"faq\"}}\">F.A.Q.</a></h2>\r\n<p>Still not sure how everything works? Check out our FAQ page.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item-page\">\r\n<div class=\"order-a-bag\">\r\n<div class=\"content-img\"><img style=\"padding: 47px 0px;\" src=\"{{media url=\"wysiwyg/Untitled-1_1.jpg\"}}\" alt=\"\" /></div>\r\n<a class=\"fancybox\" href=\"#order-a-bag\"><span><span>Order A Bag</span></span></a></div>\r\n<div class=\"or-item-page\">\r\n<h2>OR</h2>\r\n</div>\r\n<div class=\"print-a-shipping-label\">\r\n<div class=\"content-img\"><img src=\"{{media url=\"wysiwyg/Untitled-2_1.jpg\"}}\" alt=\"\" /></div>\r\n<a class=\"fancybox\" href=\"#print-a-label\"><span><span>Print A Shipping Label</span></span></a></div>\r\n</div>\r\n</div>\r\n</div>', '2013-08-31 17:41:43', '2013-10-07 15:57:06', '1');
