INSERT INTO `cms_block` VALUES ('24', 'Dont Send Us', 'do_dont_send_us', '<div class=\"guidelinesCont dont\">\r\n<div class=\"header\">Don\'t Send Us<em class=\"icon icon-remove\"></em></div>\r\n<div class=\"text\">\r\n<ul>\r\n<li>Men\'s or kids\' clothes</li>\r\n<li>Dirty, damaged or worn items</li>\r\n<li>Non-clothing items (purses, shoes, belts, etc.)</li>\r\n<li>Items from unlisted or unaccepted brands</li>\r\n</ul>\r\n</div>\r\n<div class=\"brandHeader\">Lower-end brands like</div>\r\n<div class=\"featuredBrandsCont\">\r\n<div class=\"col4 column\">\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>Forever 21</div>\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>H&amp;M</div>\r\n</div>\r\n<div class=\"col5 column\">\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>Target</div>\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>Wal-Mart</div>\r\n</div>\r\n<div class=\"col6 column\">\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>Kohl\'s</div>\r\n<div class=\"featuredBrand\"><em class=\"icon-remove\"></em>Old Navy</div>\r\n</div>\r\n</div>\r\n</div>', '2013-10-01 15:52:47', '2013-10-06 15:31:14', '1');
