INSERT INTO `cms_page` VALUES ('1', '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', null, '<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n', '2013-07-29 03:14:26', '2013-07-29 03:14:26', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('2', 'Home page', 'one_column', null, null, 'home', null, '<div class=\"main-top\">\r\n<div class=\"left\">{{block type=\"core/template\" template=\"catalog/category/home-category.phtml\"}}</div>\r\n<div class=\"right\">{{block type=\"cms/block\" block_id=\"sell-online\"}} {{block type=\"mtslideshow/content_top\" name=\"mtslideshow-content-top\" template=\"magenthemes/mtslideshow/content.phtml\"}}</div>\r\n</div>\r\n<div class=\"signup-newsletter\"><a href=\"{{store url=\"newsletter/manage/index/\"}}\"><span>Sign Up For Our Newsletter</span></a>- Keep Track Of New Arrivals!\r\n<p>Stay up to date with everything in our online store.</p>\r\n</div>\r\n<div>{{widget type=\"cms/widget_block\" template=\"cms/widget/static_block/default.phtml\" block_id=\"19\"}}</div>\r\n<div class=\"connect-with-us\">WHAT\'S NEW ONLINE</div>\r\n<div>{{widget type=\"cms/widget_block\" template=\"cms/widget/static_block/default.phtml\" block_id=\"20\"}}</div>', '2013-07-29 03:14:27', '2013-09-16 07:14:09', '1', '0', '<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->\r\n<reference name=\"content\">\r\n<block type=\"core/template\" name=\"home-feature\" template=\"catagory/product/feature.phtml\"/>\r\n</reference>', null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('3', 'Contact Us', 'one_column', null, null, 'contact-us', null, '<div class=\"contact-main\"><img src=\"{{media url=\"wysiwyg/phone.jpg\"}}\" alt=\"\" />\r\n<div class=\"contact-content\">\r\n<h2>CONTACT US.</h2>\r\n<ul>\r\n<li>\r\n<div class=\"left label\">Phone:</div>\r\n<div class=\"right text-content\">555.234.5678</div>\r\n</li>\r\n<li>\r\n<div class=\"left label\">Email:</div>\r\n<div class=\"right text-content\"><a href=\"mailto:gs@greenestreet.com\">gs@greenestreet.com</a></div>\r\n</li>\r\n<li>\r\n<div class=\"left label\">Address:</div>\r\n<div class=\"right text-content\">1260 East Mermaid Ln<br />Wyndmoor, PA 19038</div>\r\n</li>\r\n<li>\r\n<div class=\"left label\">Twitter:</div>\r\n<div class=\"right text-content\"><a href=\"#\">@ ShopGreenSt</a></div>\r\n</li>\r\n</ul>\r\n</div>\r\n<!--div>{{block type=\"cms/block\" block_id=\"instagram\"}}</div-->\r\n{{block type=\"instagramconnect/homepage\" template=\"ikantam/instagram_connect/homepage.phtml\"}}\r\n</div>', '2013-07-29 03:14:27', '2013-09-13 15:53:35', '1', '0', null, null, null, null, null, null);
