INSERT INTO `cms_page` VALUES ('14', 'Privacy Policy', 'two_columns_right', null, null, 'privacy-policy', 'Privacy Policy', '<div class=\"page-title\">\r\n<p class=\"Standard\">Welcome to the ShopGreeneStreet.com website (the \"Site\"). Mastrilli, Inc. provides services to you subject to the notices, terms, and conditions set forth in this agreement (the \"Agreement\"). In addition, when you use any of our services (e.g., Customer Reviews), you will be subject to the rules, guidelines, policies, terms, and conditions applicable to such service, and they are incorporated into this Agreement by this reference. We reserve the right to change this Site and these terms and conditions at any time.&nbsp;<strong>ACCESSING, BROWSING OR OTHERWISE USING THE SITE INDICATES YOUR AGREEMENT TO ALL THE TERMS AND CONDITIONS IN THIS AGREEMENT, SO PLEASE READ THIS AGREEMENT CAREFULLY BEFORE PROCEEDING.</strong></p>\r\n<p class=\"Standard\"><strong>USE OF SITE</strong></p>\r\n<p class=\"Standard\">You represent and warrant that you are at least 18 years old or visiting the Site under the supervision of a parent or guardian.</p>\r\n<p class=\"Standard\">Subject to the terms and conditions of this Agreement, we hereby grant you a limited, revocable, non-transferable and non-exclusive license to access and use the Site by displaying it on your internet browser only for the purpose of shopping for personal items sold on the Site and not for any commercial use or use on behalf of any third party, except as explicitly permitted by us in advance. Any breach of this Agreement shall result in the immediate revocation of the license granted in this paragraph without notice to you.</p>\r\n<p class=\"Standard\">Except as permitted in the paragraph above, you may not reproduce, distribute, display, sell, lease, transmit, create derivative works from, translate, modify, reverse-engineer, disassemble, decompile or otherwise exploit this Site or any portion of it unless expressly permitted by us in writing. You may not make any commercial use of any of the information provided on the Site or make any use of the Site for the benefit of another business unless explicitly permitted by us in advance. We reserve the right to refuse service, terminate accounts, and/or cancel orders at its discretion, including, without limitation, if we believe that customer conduct violates applicable law or is harmful to our interests.</p>\r\n<p class=\"Standard\">You shall not upload to, distribute, or otherwise publish through this Site any Content, information, or other material that (a) violates or infringes the copyrights, patents, trademarks, service marks, trade secrets, or other proprietary rights of any person; (b) is libelous, threatening, defamatory, obscene, indecent, pornographic, or could give rise to any civil or criminal liability under U.S. or international law; or (c) includes any bugs, viruses, worms, trap doors, Trojan horses or other harmful code or properties.</p>\r\n<p class=\"Standard\">Content provided on this site is solely for informational purposes. It is your sole responsibility to consult a licensed physician or qualified health care professional for advice, diagnosis, and/or treatment of any health related condition. Submissions or opinions expressed on this Site are that of the individual expressing such Submission or opinion and may not reflect our opinions. Product representations expressed on this Site are that of the vendor and are not made by us.</p>\r\n<p class=\"Standard\">We may assign you a password and account identification to enable you to access and use certain portions of this Site. Each time you use a password or identification, you will be deemed to be authorized to access and use the Site in a manner consistent with the terms and conditions of this Agreement, and we have no obligation to investigate the authorization or source of any such access or use of the Site. <strong>YOU WILL BE SOLELY RESPONSIBLE FOR ALL ACCESS TO AND USE OF TH