mments, or other Content by us will not infringe upon or violate the rights of any third party. You shall not use a false e mail address, pretend to be someone other than yourself or otherwise mislead us or third parties as to the origin of any Submissions or Content. We may, but shall not be obligated to, remove or edit any Submissions (including comments or reviews) for any reason.</p>\r\n<p class=\"Standard\"><strong>INTELLECTUAL PROPERTY</strong></p>\r\n<p class=\"Standard\">All text, graphics, button icons, images, audio clips, and software (collectively, \"Content\"), belongs exclusively to Mastrilli, Inc., or its affiliates. The collection, arrangement, and assembly of all Content on this Site (the \"Compilation\") belongs exclusively to Mastrilli, Inc. or its affiliates. All software used on this Site (the \"Software\") is the property of Mastrilli, Inc., its affiliates or its Software suppliers. The Content, the Compilation and the Software are all protected by U.S. and international copyright laws. GREENESTREET.COM, SHOPGREENESTREET.COM, SELLGREENESTREET.COM and other logos, slogans, trade names or words are registered trademarks, trademarks or service marks of Mastrilli, Inc., its affiliates, suppliers, or third parties. The use of any of our trademarks or service marks without our express written consent is strictly prohibited. You may not use our trademarks or service marks in connection with any product or service in any way that is likely to cause confusion. You may not use our trademarks or service marks in any manner that disparages or discredits us. You may not use any of our trademarks or service marks in meta tags without prior explicit consent.</p>\r\n<p class=\"Standard\"><strong>PRIVACY POLICY</strong></p>\r\n<p class=\"Standard\">Please review our Privacy Policy, which also governs your visit to this Site, to understand our practices. Our Privacy Policy is available at <a href=\"http://www.zappos.com/privacy-policy\">http://www.g</a>reenestre