INSERT INTO `cms_page` VALUES ('18', 'Outlines Shop How It Works', 'one_column', null, null, 'outlines-shop-how-it-works', null, '<div id=\"how-selling-online-works\">\r\n<h1>How Selling Online Works</h1>\r\n<img src=\"{{media url=\"wysiwyg/OutlinesShopHowItWorks.png\"}}\" alt=\"\" />\r\n<div class=\"four-title\"><span>ORDER A BAG</span> <span>SHIP IT OUT</span> <span>WE SELL IT</span> <span>GET PAID</span></div>\r\n<div class=\"box-text\">\r\n<div class=\"box-text-title\">\r\n<h2 class=\"title-white\">WHAT WE</h2>\r\n<h2 class=\"title-green\">ACCEPT</h2>\r\n</div>\r\n<div class=\"box-text-content\">\r\n<div class=\"item first\">\r\n<p><strong>Clothing In New To Like-New Condition</strong><br /> Items should be in pristine condition. Learn more<br /> about our high quality standards here.</p>\r\n<p><strong>Clothing That\'s Freshly Laundered</strong><br /> Clothing should look and smell clean. Please <br /> wash and fully dry all clothing before placing it in <br /> the bag. Clothing that is still moist does not travel <br /> well in a sealed plastic bag</p>\r\n<p><strong>Top Brands</strong><br /> Such as Tea Collection, Gap, Gymboree, and <br /> Hanna Andersson for kids. For women\'s clothing <br /> we love J Crew, Anthropologie, Ann Taylor, <br /> Banana Republic, Theory, and Tommy Hilﬁger</p>\r\n</div>\r\n<div class=\"item\">\r\n<p><strong>Nwt (New With Tags) Items</strong><br /> We pay more for items that are so new that they <br /> still include price tags - however, we do not <br /> guarantee we accept all nwt tag items, as they <br /> must still meet our standards and be free of <br /> imperfections</p>\r\n<p><strong>Outﬁts</strong><br /> Help us identify items meant to go together by <br /> clipping them together or putting them in a <br /> smaller bag</p>\r\n<p><strong>Clothing Related Accessories</strong><br /> Like hats, mittens, and scarves</p>\r\n</div>\r\n<div class=\"item last\">\r\n<p><strong>Clothing In New To Like-New Condition</strong><br /> Items should be in pristine condition. Learn more <br /> about our high quality standards here.</p>\r\n<p><strong>Clothing That\'s Freshly Laundered</strong><br /> Clothing should look and smell clean. Please <br /> wash and fully dry all clothing before placing it in <br /> the bag. Clothing that is still moist does not travel <br /> well in a sealed plastic bag</p>\r\n<p><strong>Shoes</strong><br /> In addition to checking the top surface and <br /> interior of footwear, please be sure to check the <br /> soles to ensure they are clean and free of scuff</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"box-text\">\r\n<div class=\"box-text-title\">\r\n<h2 class=\"title-white\">WHAT WE</h2>\r\n<h2 class=\"title-red\">DON&rsquo;T</h2>\r\n</div>\r\n<div class=\"box-text-content\">\r\n<div class=\"item first\">\r\n<p><strong>Clothing That Shows Any Signs Of Wear</strong><br /> Any clothing with rips, tears, stains, pilling, <br /> fading, shrinkage, etc., cannot be accepted</p>\r\n<p><strong>Clothing From Discount Brands</strong><br /> Athletics Works, Faded Glory, Garaminals, <br /> George, Kids Connection, Koala Kids, Max Grey, <br /> Sonoma and Walmart.</p>\r\n</div>\r\n<div class=\"item\">\r\n<p><strong>Homemade/Altered Items</strong><br /> Especially any kids\' clothing or women\'s dresses <br /> (women\'s jeans are ok)</p>\r\n<p><strong>Local Or Niche Clothing</strong><br /> Hometown teams and places that do not have a <br /> broad national audience</p>\r\n</div>\r\n<div class=\"item last\">\r\n<p><strong>Sleepwear, Socks And Undergarments</strong></p>\r\n<p><strong>Specialty Items</strong><br /> Like real fur items, prom dresses, bridesmaids <br /> dresses, wedding dresses. However, we do take <br /> cocktail dresses</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"let-do-it\"><a class=\"link\" href=\"#\">ORDER A BAG</a></div>\r\n</div>', '2013-08-18 14:51:24', '2013-08-21 15:06:34', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('19', 'Sell Your Clothes With Us', 'one_column', null, null, 'sell-your-clothes-with-us', null, '<div class=\"main-page sell-your-clothes-with-us-page\">\r\n<div class=\"title-page\">\r\n<h1>Sell Your Clothes With Us</h1>\r\n</div>\r\n<div class=\"content-page\">\r\n<div class=\"item-page\">\r\n<div class=\"left-item-page\"><img src=\"{{media url=\"wysiwyg/819OutlinesShopSell1_07.png\"}}\" alt=\"\" /></div>\r\n<div class=\"right-item-page\">\r\n<h2>Men\'s + Women\'s + Children\'s</h2>\r\n<ul>\r\n<li><label>1</label> <span>Order a bag which we\'ll send to you for free or print a prepaid shipping label.</span></li>\r\n<li><label>2</label> <span>Look over our guidelines and brand list to see if your items meet our criteria.</span></li>\r\n<li><label>3</label> <span>Fill the bag up with Women\'s, Men\'s, or Children\'s clothing and send it out.</span></li>\r\n<li><label>4</label> <span>We sell your stuff and you\'ll recieve 50% commission via check or PayPal!</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"item-page\">\r\n<div class=\"left-item-center-page\">\r\n<div class=\"left-item\">\r\n<h3>Yes</h3>\r\n<ul class=\"item-yes\">\r\n<li><span>Top brands like Anthropologie and J.Crew. Our motto\'s \"From Gap To Gucci\".</span></li>\r\n<li><span>Clothes that are in excellent condition. We love stuff still with tags on!</span></li>\r\n<li><span>Clothes that are clean and frshly laundered!</span></li>\r\n<li><span>Items that are no more than 2-3 years old.</span></li>\r\n<li><span>You can send us Women\'s, Men\'s, or Children\'s items! Ship all at once!</span></li>\r\n</ul>\r\n</div>\r\n<div class=\"right-item\">\r\n<h3>No</h3>\r\n<ul class=\"item-no\">\r\n<li><span>Discount brands from places like Walmart. We also don\'t accept homemade clothing!</span></li>\r\n<li><span>Clothes that are damaged. Items with stains, tears, or faded graphics usually don\'t sell well.</span></li>\r\n<li><span>Clothes that aren\'t washed or are missing labels.</span></li>\r\n<li><span>Swimwear or undergarments.</span></li>\r\n<li><span>Items that are out of style or over 3 years old.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"right-item-center-page\">\r\n<div class=\"brand-list\">\r\n<h2><a href=\"{{store url=\"our-approved-brands-list\"}}\">Brand List</a></h2>\r\n<p>See which brands of Women\'s, Men\'s, or Children\'s clothing we take and which ones we don\'t.</p>\r\n</div>\r\n<div class=\"guidelines\">\r\n<h2><a href=\"{{store url=\"clothing-guidelines\"}}\">Guidelines</a></h2>\r\n<p>Read our full list of guidelines to make sure you\'re getting the most out of your recycled items.</p>\r\n</div>\r\n<div class=\"faq\">\r\n<h2><a href=\"{{store url=\"faq\"}}\">F.A.Q.</a></h2>\r\n<p>Still not sure how everything works? Check out our FAQ page.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item-page\">\r\n<div class=\"order-a-bag\">\r\n<div class=\"content-img\"><img src=\"{{media url=\"wysiwyg/819OutlinesShopSell1_15.png\"}}\" alt=\"\" /></div>\r\n<button class=\"button\" onclick=\"setLocation(\'#\')\" type=\"button\"><span><span>Order A Bag</span></span></button></div>\r\n<div class=\"or-item-page\">\r\n<h2>OR</h2>\r\n</div>\r\n<div class=\"print-a-shipping-label\">\r\n<div class=\"content-img\"><img src=\"{{media url=\"wysiwyg/819OutlinesShopSell1_18.png\"}}\" alt=\"\" /></div>\r\n<button class=\"button\" onclick=\"setLocation(\'#\')\" type=\"button\"><span><span>Print A Shipping Label</span></span></button></div>\r\n</div>\r\n</div>\r\n</div>', '2013-08-27 17:29:10', '2013-08-31 14:33:22', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('20', 'Clothing Guidelines', 'one_column', null, null, 'clothing-guidelines', null, '<div class=\"main-page clothing-guidelines-page\">\r\n    <div class=\"title-page\">\r\n        <h1>Clothing Guidelines</h1>\r\n    </div>\r\n    <div class=\"content-page\">\r\n        <table border=\"0\" style=\"\">\r\n            <tr>\r\n                <td class=\"td-left content-text\">\r\n                    <div class=\"left-item-page\">\r\n                        <h3>Yes</h3>\r\n                        <ul class=\"item-yes\">\r\n                            <li>\r\n                                <h4>Clothing In New To Like-New Condition</h4>\r\n                                <p>Items should be in pristine condition. Learn more about our hight quality standards here.</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Clothing That\'s Freshly Laundered</h4>\r\n                                <p>Clothing should look and smell clean. Please wash and fully dry all clothing before placing it in the bag. Clothing that is still moist does not travel well in a sealed plastic bag</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Top Brands</h4>\r\n                                <p>Such as Tea Collection, Gap, Gymboree, and Hanna Andersson for kids. For women\'s clothing we love J Crew, Anthropologie, Ann Taylor, Banana Republic, Theory, and Tommy Hilfiger</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Nwt (New With tags) Items</h4>\r\n                                <p>We pay more for items that are so new that they still include price tags - howerver, we do not guarantee we accept all nwt tag items, are they must still meet our standards and be free of imperfections</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Outfits</h4>\r\n                                <p>Help us identify items meant to go together by clipping them together or putting them in a smaller bag</p>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n                <td class=\"td-right content-text\">\r\n                    <div class=\"right-item-page\">\r\n                        <h3>No</h3>\r\n                        <ul class=\"item-no\">\r\n                            <li>\r\n                                <h4>Clothing That Shows Any Signs Of Wear</h4>\r\n                                <p>Any clothing with rips, tears, stains, pilling, fading, shrinkage, etc., can not be accepted</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Clothing From Discount Brands</h4>\r\n                                <p>Athletics Works, Faded Glory, Garaminals, George, Kids Connection, Koala Kids, Max Grey, Sonoma and Walmart.</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Sleepwear, Socks And Undergarments</h4>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Specialty Items</h4>\r\n                                <p>Like real fur items, prom dresses, briesmaids dresses, wedding dresses. However, we do take cocktail dresses</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Items Missing Labels</h4>\r\n                                <p>Brand and size need to be identifiabale</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Homemade/Altered Items</h4>\r\n                                <p>Espectally and kid\'s clothing or women\'s dressesn (women\'s jeans are ok)</p>\r\n                            </li>\r\n                            <li>\r\n                                <h4>Local Or Niche Clothing</h4>\r\n                                <p>Hometown teams and places that do not have a broad national audience</p>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td class=\"td-left\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines1.png\"}}\" alt=\"\" /></td>\r\n                <td class=\"td-right\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines2.png\"}}\" alt=\"\" /></td>\r\n            </tr>\r\n            <tr>\r\n                <td class=\"td-left\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines3.png\"}}\" alt=\"\" /></td>\r\n                <td class=\"td-right\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines4.png\"}}\" alt=\"\" /></td>\r\n            </tr>\r\n            <tr>\r\n                <td class=\"td-left\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines5.png\"}}\" alt=\"\" /></td>\r\n                <td class=\"td-right\"><img src=\"{{media url=\"wysiwyg/clothing-guidelines6.png\"}}\" alt=\"\" /></td>\r\n            </tr>\r\n        </table>\r\n    </div>\r\n</div>\r\n', '2013-08-28 17:22:36', '2013-08-28 17:39:56', '1', '0', null, null, null, null, null, null);
