INSERT INTO `core_email_template` VALUES ('1', 'Order A Bag', '<body style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<div style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" height=\"100%\" width=\"100%\">\r\n        <tr>\r\n            <td align=\"center\" valign=\"top\" style=\"padding:20px 0 20px 0\">\r\n                <!-- [ header starts here] -->\r\n                <table bgcolor=\"FFFFFF\" cellspacing=\"0\" cellpadding=\"10\" border=\"0\" width=\"650\" style=\"border:1px solid #E0E0E0;\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <a href=\"{{store url=\"\"}}\"><img src=\"{{var logo_url}}\" alt=\"{{var logo_alt}}\" style=\"margin-bottom:10px;\" border=\"0\"/></a></td>\r\n                    </tr>\r\n                <!-- [ middle starts here] -->\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <h1 style=\"font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;\"\">Dear {{var nameAdmin}},</h1>                      \r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> Email: {{var emailTo}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> First Name: {{var firstname}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> Last Name: {{var lastname}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> Address: {{var address}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> Address2: {{var address2}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> City: {{var city}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> State: {{var state}}</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\"> Zip Code: {{var zip}}</p>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td bgcolor=\"#EAEAEA\" align=\"center\" style=\"background:#EAEAEA; text-align:center;\"><center><p style=\"font-size:12px; margin:0;\">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\r\n                    </tr>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>\r\n</body>', null, '2', 'Order A Bag: {{var emailTo}}', null, null, null, '2013-09-12 15:04:07', null, null);
